import React, { Component } from "react";
import withStyles from '@material-ui/core/styles/withStyles';

const styles = {
    card: {
        display: 'flex'
    }
}

class Shout extends Component {
  render() {
      const { classes } = this.props;
    return ;
  }
}

export default withStyles(styles)(Shout);
